INSERT INTO products (id, name, slug, description, regularPrice, salePrice, categoryId, stock, status, blessingTemple, blessingMaster, createdAt, updatedAt)
VALUES (510049, 'Eastern Ancient Wisdom Text Pendant', 'eastern-ancient-wisdom-text-pendant', 'This pendant bears a timeless text rooted in millennia-old Eastern wisdom — sacred scriptures that have long been linked to mindfulness, inner calm, and the quiet strength of spiritual centering. Each piece is elevated by a traditional Eastern ceremonial enlivenment performed at sacred temples, a practice deeply woven into ancient cultural heritage, focused on aligning the piece with the resonant energy of intentional presence. Crafted with polished, durable metals in both lustrous gold and elegant silver finishes, the intricate engraved script (classic passages of Eastern philosophical legacy including Heart Sutra, Great Compassion Mantra, and other sacred texts) and refined design blend understated luxury with profound symbolic depth. Worn close to the body, it serves as a tangible reminder of inner balance — a subtle, elegant link to the quiet wisdom of ancient Eastern traditions. For seekers drawn to the mystique of Eastern cultural heritage and symbolic pieces that carry intentional, centering energy.', 59.0, 49.0, 8, 999, 'published', '五台山', '五台山高僧', NOW(), NOW());

